import React from 'react';
import Display from './Display';
import AddInfo from './AddInfo';
const Info = () => {
    state= {
        displayInfos: [
          { name: null, birthMonth: null, about: null }
        ]
      }

      addInfo = (info) => {
        let displayInfos = [...this.state.displayInfos, info];
        console.log(displayInfos);
        this.setState({
          displayInfos: displayInfos
        })
      }
  return(
    <div className='center'>
      <h4 className='container center'>Person Information</h4>
      <p> This is Person Information page.</p>
      <Display displayInfos={this.state.displayInfos}/>
      <AddInfo addInfo={this.addInfo} />
    </div>
  )
}

export default Info;
